import Card from '@mui/material/Card';

const App = () => {

    return (
        <div id="appContainer">

            <div id="nav">
                <div>Home</div>
                <div>About</div>
            </div>
            <Routes>
            <div id="content">

                <Route path="/" element={<Home />} />
                <Route path="/about" element={<About />} />




            </div>
            </Routes>




        </div>
    );
    }



export default App;
